import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Shop from './components/Shop/Shop';
import Product from './components/Product/Product';


function App() {

  return (
    <div>
      <Header></Header>
      <Shop></Shop>
      <Product></Product>
    </div>
  );
}


export default App;
